// src/lang.js
const t = {
  en: {
    services: "Our Services",
    viewDetails: "View Details",
    whatsapp: "Book on WhatsApp",
    contact: "Contact",
    duration: "Duration",
    back: "Back",
    allServices: "All Services",
    homePickup: "We also collect orders from home",
  },
  hi: {
    services: "हमारी सेवाएँ",
    viewDetails: "विवरण देखें",
    whatsapp: "व्हाट्सएप पर बुक करें",
    contact: "संपर्क",
    duration: "अवधि",
    back: "वापस",
    allServices: "सभी सेवाएँ",
    homePickup: "हम घर से भी ऑर्डर लेने आते हैं",
  },
  gu: {
    services: "અમારી સેવાઓ",
    viewDetails: "વિગતો જુઓ",
    whatsapp: "વોટ્સએપ પર બુક કરો",
    contact: "સંપર્ક",
    duration: "સમયગાળો",
    back: "પાછા",
    allServices: "બધી સેવાઓ",
    homePickup: "અમે ઘરે આવીને ઓર્ડર લઈ  છીએ",

  }
};

export default t;
